import{_ as a,c as e,o as r,ag as i}from"./chunks/framework.CgtRPpXH.js";const c=JSON.parse('{"title":"优秀程序员的10个习惯","description":"","frontmatter":{"title":"优秀程序员的10个习惯","date":"2020-05-20T00:00:00.000Z","tags":["Coding"],"categories":["随笔"]},"headers":[],"relativePath":"blog/随笔/优秀程序员的10个习惯.md","filePath":"blog/随笔/优秀程序员的10个习惯.md","lastUpdated":1733335015000}'),t={name:"blog/随笔/优秀程序员的10个习惯.md"},o=i('<h2 id="_1-想清楚-再动手写代码" tabindex="-1">1. 想清楚，再动手写代码 <a class="header-anchor" href="#_1-想清楚-再动手写代码" aria-label="Permalink to &quot;1. 想清楚，再动手写代码&quot;">​</a></h2><p>刚入行的新手，为了展示自己的能力，拿到需求迫不及待地就开始上手写代码，大忌！ <a href="http://igeekbar.com/igeekbar/networks/uploadimg/f498d033-19df-4ff8-be06-67da397aa80e.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-65bfb7729947b455.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a></p><h2 id="_2-不交流-就会头破血流" tabindex="-1">2. 不交流，就会头破血流 <a class="header-anchor" href="#_2-不交流-就会头破血流" aria-label="Permalink to &quot;2. 不交流，就会头破血流&quot;">​</a></h2><p>不爱说话和沟通，需求都理解错误了，最后做出来才发现，只能加班返工。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/2bcf0394-4d61-4f30-affa-87b56e4cb92f.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-6b24a2e41de5bbf8.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a></p><h2 id="_3-文档没人看-但还是要写" tabindex="-1">3. 文档没人看，但还是要写 <a class="header-anchor" href="#_3-文档没人看-但还是要写" aria-label="Permalink to &quot;3. 文档没人看，但还是要写&quot;">​</a></h2><p>文档的作用大部分时候不是用来沟通的，是用来做记录的，大部分需求还是通过口头沟通，但是不写文档做记录，后续就容易扯皮。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/ea8f02cc-66c1-4aa8-8d52-e8293f53783c.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-c2c6bd85dab15e46.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a></p><h2 id="_4-一定要写注释" tabindex="-1">4. 一定要写注释 <a class="header-anchor" href="#_4-一定要写注释" aria-label="Permalink to &quot;4. 一定要写注释&quot;">​</a></h2><h3 id="时间久了-你会连自己的代码都看不懂。" tabindex="-1">时间久了，你会连自己的代码都看不懂。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/d724d8dd-0078-42e3-a418-43b74c93e5fa.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-770035597a1d12dd.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a> <a class="header-anchor" href="#时间久了-你会连自己的代码都看不懂。" aria-label="Permalink to &quot;时间久了，你会连自己的代码都看不懂。[![image](http://upload-images.jianshu.io/upload_images/4262139-770035597a1d12dd.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)](http://igeekbar.com/igeekbar/networks/uploadimg/d724d8dd-0078-42e3-a418-43b74c93e5fa.jpeg)&quot;">​</a></h3><h2 id="_5-别指望需求会稳定" tabindex="-1">5. 别指望需求会稳定 <a class="header-anchor" href="#_5-别指望需求会稳定" aria-label="Permalink to &quot;5. 别指望需求会稳定&quot;">​</a></h2><h3 id="产品需求是根据商业需求不断调整的-改需求是再正常不过的事-别抱怨。" tabindex="-1">产品需求是根据商业需求不断调整的，改需求是再正常不过的事，别抱怨。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/bd419d6d-cea0-4d78-90e1-363a99577a04.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-c67661bb5a058177.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a> <a class="header-anchor" href="#产品需求是根据商业需求不断调整的-改需求是再正常不过的事-别抱怨。" aria-label="Permalink to &quot;产品需求是根据商业需求不断调整的，改需求是再正常不过的事，别抱怨。[![image](http://upload-images.jianshu.io/upload_images/4262139-c67661bb5a058177.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)](http://igeekbar.com/igeekbar/networks/uploadimg/bd419d6d-cea0-4d78-90e1-363a99577a04.jpeg)&quot;">​</a></h3><h2 id="_6-业务高于技术" tabindex="-1">6. 业务高于技术 <a class="header-anchor" href="#_6-业务高于技术" aria-label="Permalink to &quot;6. 业务高于技术&quot;">​</a></h2><p>如果技术不为公司商业做服务，那将毫无价值，公司赚钱才是硬道理。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/a70e77d7-8dd3-43b6-9b75-d3aaf8aee853.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-cc46c211260c3e0d.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a></p><h2 id="_7-不要心存侥幸" tabindex="-1">7. 不要心存侥幸 <a class="header-anchor" href="#_7-不要心存侥幸" aria-label="Permalink to &quot;7. 不要心存侥幸&quot;">​</a></h2><p>你隐约感觉会出bug的地方，就一定会出bug。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/f117c0dc-3e91-49e9-8e2d-5eba60cbd940.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-bb58f6ae36876bdf.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a></p><h2 id="_8-自己先测几遍" tabindex="-1">8. 自己先测几遍 <a class="header-anchor" href="#_8-自己先测几遍" aria-label="Permalink to &quot;8. 自己先测几遍&quot;">​</a></h2><p>不要写完就扔给测试人员去测，经自己手的东西，要保证质量。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/bc2f262a-abad-4b8c-b65e-ba45e02298bf.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-5d34187f433ba77c.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a></p><h2 id="_9-尽可能自己解决问题" tabindex="-1">9. 尽可能自己解决问题 <a class="header-anchor" href="#_9-尽可能自己解决问题" aria-label="Permalink to &quot;9. 尽可能自己解决问题&quot;">​</a></h2><p>遇到不懂的问题，要先尽力解决，别动不动就截个图扔在别人求帮忙，上司和同事不是来给你擦屁股的，但是真的搞砸了就要尽快求助。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/67024b21-962f-4610-8996-132b6e960fe2.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-50a008af14c57fc0.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a></p><h2 id="_10-慎用新技术" tabindex="-1">10. 慎用新技术 <a class="header-anchor" href="#_10-慎用新技术" aria-label="Permalink to &quot;10. 慎用新技术&quot;">​</a></h2><p>新技术是好东西，但没有百分百把握，自作主张用了，多半是作死。<a href="http://igeekbar.com/igeekbar/networks/uploadimg/b2eea913-70ed-49f4-bdbd-262ae84a8e75.jpeg" target="_blank" rel="noreferrer"><img src="http://upload-images.jianshu.io/upload_images/4262139-acb667ad74247a31.jpeg?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240" alt="image"></a></p><p>转载自：<a href="http://igeekbar.com/igeekbar/post/858.htm" target="_blank" rel="noreferrer">http://igeekbar.com/igeekbar/post/858.htm</a></p>',21),g=[o];function d(l,p,s,m,h,n){return r(),e("div",null,g)}const u=a(t,[["render",d]]);export{c as __pageData,u as default};
